import React, {Component} from 'react';
import '../../App.css';
//import axios from 'axios';
//import cookie from 'react-cookies';
//import {Redirect} from 'react-router';

class BuyerProfile extends Component {


    pictureChangeHandler = (e) => {
        this.setState({
            profilePicture : e.target.name
        })
    }

    render() {

        let profilePicture = () => {
            return(
                <div>
                    <h4 class="font-bold">Profile Picture</h4>
                    <img></img> 
                </div>
            )
        } 

        let buyerProfile = () => {
            return(
                <div>
                <div><h4 class="font-bold">Your Account</h4><br/>
                <h5 class="font-bold">Name</h5>
                </div>

                <div>
                <h5 class="font-bold">Email</h5>
                </div>
                <div>
                <h5 class="font-bold">Password</h5>
                </div>
                </div>
            )
        }

        let buyerPhone = () => {
            return(
                <div>
                    <h4 class="font-bold">Phone Number</h4><br/>
                    <h5 class="font-bold">Home<br/>
                    6692789950
                    </h5>
                </div>
            )
        }

        let redir = '';

        let redirectVal = () => {
            if(this.state.name="profilePicture")
            {
                redir = profilePicture();
            }
            else if(this.state.name="profile")
            {
                redir = buyerProfile();
            }
            else if(this.state.name="phone")
            {
                redir = buyerPhone();
            }

            return(redir);
        }

        return(
            <div>
                <div>
                    <br/>
                    <br/>
                </div>
                <div class="col-md-3 profile-div">
                <h3 class="font-bold">Your Account</h3><br/>
                <h5 class="font-bold" name="profilePicture" onchange={this.pictureChangeHandler} onclick={this.redirectVal}><a>Profile Picture</a></h5><br/>
                <h5 class="font-bold" name="profile" onclick={this.redirectVal}><a>Profile</a></h5><br/>
                <h5 class="font-bold" name="phone" onclick={this.redirectVal}><a>Phone</a></h5><br/>
                </div>

                <div></div>

                <div class="col-md-8 profile-div">
                {redirectVal}
                </div>
            </div>
        )
    }
}

export default BuyerProfile;
